import React from 'react'
import homeBg from '../../images/hero-image-01.jpg'
import styles from './Home.module.css'
export default function Home() {
  return (
    <>  
   <div className={`homeBg ${styles.homeBg}`}></div>
 <div className={`${styles.Bg}`} style={{ backgroundImage: `url(${homeBg})` }}>
  Overlay text
  </div>

</>
  )
}
